import React from "react";

export  function Paginado({dogsPage, allDogs, paginado}){
    const pageNumber = [];
    for(let i = 0; i <= Math.ceil(allDogs/dogsPage); i++){
        pageNumber.push(i + 1)
    }

    return(
        <>
            <div>
                <ul>
                    {
                        pageNumber && 
                        pageNumber.map( num => (
                            <li key = {num}>
                                <p onClick = {() => paginado(num)}>{num}</p>
                            </li>
                        ))}
                </ul>
            </div>
        </>
    )
};
